import React from "react";
import { Paper } from "@material-ui/core";

const About = () => {
  const styles = {
    margin: "auto",
    width: "50%",
    marginTop: "50px",
  };
  return (
    <div className="about-container">
      <Paper style={styles}>
        <h1>LEVEL UP is a Productivity app!</h1>
      </Paper>
    </div>
  );
};

export default About;
